### Summary of Core Topics, Concepts, Principles, and Equations

#### 1. **Fetch API and HTTP Requests**
- **Concepts**: Making POST requests using the Fetch API, setting headers, and handling JSON data.
- **Key Points**:
  - Use `Content-Type: application/json` for JSON data.
  - Use `JSON.stringify()` to convert data to JSON format.
  - Example:
    ```javascript
    fetch("/api/submit", {
      method: "POST",
      headers: {
        "Content-Type": "application/json"
      },
      body: JSON.stringify(data),
    });
    ```

#### 2. **Vue.js and Single File Components**
- **Concepts**: Structure and usage of `.vue` files, Vue components, and lifecycle hooks.
- **Key Points**:
  - `.vue` files contain template, script, and style sections.
  - `.vue` files must be compiled before running in the browser.
  - Lifecycle hooks: `created`, `mounted`, `beforeCreate`, `beforeMount`.

#### 3. **Web Storage APIs**
- **Concepts**: `localStorage` and `sessionStorage` for client-side data storage.
- **Key Points**:
  - `localStorage`: Persistent storage with no expiration.
  - `sessionStorage`: Storage for the duration of the page session.
  - Both store data in key-value pairs.

#### 4. **Single Page Applications (SPA) and Progressive Web Apps (PWA)**
- **Concepts**: Client-side routing, offline capabilities, and home screen installation.
- **Key Points**:
  - SPAs use client-side routing to update content dynamically.
  - PWAs can work offline using service workers.
  - PWAs can be added to a device’s home screen.

#### 5. **Vue Router**
- **Concepts**: Routing in Vue.js applications, nested routes, and dynamic components.
- **Key Points**:
  - Use `VueRouter` to define routes and components.
  - Nested routes can be defined using `children`.
  - Example:
    ```javascript
    const router = new VueRouter({
      routes: [
        { path: "/", component: Home },
        {
          path: "/dashboard",
          component: Dashboard,
          children: [
            { path: "stats", component: Stats },
            { path: "settings", component: Settings },
          ],
        },
      ],
    });
    ```

#### 6. **Vuex for State Management**
- **Concepts**: State management, getters, mutations, and actions in Vuex.
- **Key Points**:
  - State: Centralized data store.
  - Getters: Computed properties for the store.
  - Mutations: Synchronous state changes.
  - Actions: Asynchronous operations.
  - Example:
    ```javascript
    const store = new Vuex.Store({
      state: {
        users: [
          { id: 1, name: 'Alice', status: 'active', role: 'admin' },
          { id: 2, name: 'Bob', status: 'inactive', role: 'user' },
        ]
      },
      getters: {
        activeUsers(state) {
          return state.users.filter(user => user.status === 'active');
        },
      },
      mutations: {
        updateUserStatus(state, { userId, status }) {
          const user = state.users.find(u => u.id === userId);
          if (user) {
            user.status = status;
          }
        },
      },
      actions: {
        toggleUserStatus({ commit, state }, userId) {
          const user = state.users.find(u => u.id === userId);
          if (user) {
            const newStatus = user.status === 'active' ? 'inactive' : 'active';
            commit('updateUserStatus', { userId, status: newStatus });
          }
        },
      }
    });
    ```

#### 7. **Asynchronous Operations and Promises**
- **Concepts**: Handling asynchronous operations using Promises and async/await.
- **Key Points**:
  - Use `async/await` for asynchronous operations.
  - Use `Promise` for handling asynchronous tasks.
  - Example:
    ```javascript
    async fetchData() {
      this.loading = true;
      const res = await this.simulateApiCall();
      this.message = res;
      this.loading = false;
    },
    simulateApiCall() {
      return new Promise((resolve) => {
        setTimeout(() => resolve("Fetched Data from API!"), 1000);
      });
    }
    ```

#### 8. **Vue Lifecycle Hooks**
- **Concepts**: Lifecycle hooks in Vue.js components.
- **Key Points**:
  - `created`: Called after the instance is created.
  - `mounted`: Called after the instance is mounted.
  - `beforeCreate`: Called before the instance is created.
  - `beforeMount`: Called before the instance is mounted.
  - Example:
    ```javascript
    new Vue({
      el: '#app',
      data: {
        phase: "",
        counter: 0,
        items: []
      },
      beforeCreate() {
        this.phase += "Init-"
        this.counter += 5
        this.items.push("A")
      },
      created() {
        this.phase += "Ready-"
        this.counter += 3
        this.items.push("B")
      },
      beforeMount() {
        this.phase += "Prep-"
        this.counter -= 2
        this.items.push("C")
      },
      mounted() {
        this.phase += "Live"
        this.counter *= 2
        this.items.push("D")
      }
    });
    ```

#### 9. **Vue Slots**
- **Concepts**: Using slots in Vue.js components for content distribution.
- **Key Points**:
  - Use `<slot>` to define where content should be inserted.
  - Named slots can be used for specific sections.
  - Example:
    ```javascript
    Vue.component("data-panel", {
      template: `
        <div class="panel">
          <header>
            <slot name="sidebar"></slot>
          </header>
          <main>
            <slot></slot>
          </main>
          <section>
            <slot name="actions"></slot>
          </section>
          <footer>
            <slot name="summary"></slot>
          </footer>
        </div>
      `
    });
    ```

